import React from "react"
import ProjectCard from './ProjectCard.js'
import './App.css';
import logo from './images/art.png'

const projects = [
    {link:"/proj1", image:logo, title:"rem", category:"film"}
]

function renderList(items) {
    var list = items.map(item => { 
      return <ProjectCard link={item.link} image = {item.image} title={item.title} category={item.catergory}/>
    });
    return list;
  }


function Project(props) {
  return (
    <div>
      <h1>Project</h1>
      {renderList(projects)}
      {/* <ProjectCard
        link="/proj1"
        image={logo}
        title="rem"
        category="Film"
      /> */}
    </div>
  )
}


export default Project;
